import React from "react";
import "./App.css";
import { ThemeProvider } from "@mui/material/styles";
import { theme } from "./Theme";
import { CssBaseline, Typography } from "@mui/material";

function App() {
  return (
    <React.Fragment>
      <ThemeProvider theme={theme}></ThemeProvider>
    </React.Fragment>
  );
}

export default App;
